b.background(0);

var points = [];
var inTan = [];
var outTan = [];

for (var i=0; i<20; i++) {
   var x = b.random(b.width);
   var y = b.random(b.height);
   points.push([x,y]);
   inTan.push([x-5, y-5]);
   outTan.push([x+5, y+5]);
}

b.stroke(1);
var mask = b.shape(points, inTan, outTan, false);
b.printProperties(mask);

